INSERT INTO `recipe77_eggnog_instructions` (`id`, `instruction`) VALUES
(1, 'Separate the eggs. Separate the eggs, placing the yolks in a medium bowl and the whites in a large bowl. Cover the whites and refrigerate until needed, or freeze if aging the eggnog for longer than a day.'),
(2, 'Whisk the yolks with the sweetener until the mixture is smooth, creamy, and lightened to a lemon-yellow color.'),
(3, 'Whisk in the milk, cream.'),
(4, 'Cover and refrigerate. Cover the bowl and refrigerate for at least 1 hour.'),
(5, 'Whisk the egg whites. Just before serving, whisk the reserved egg whites in a stand mixer or with a hand mixer at high speed until the whites form stiff peaks.'),
(6, 'Fold the egg whites into the eggnog. Transfer the beaten egg whites to the bowl with the eggnog and gently fold or stir the whites into the base — this gives the eggnog a frothy, extra-creamy texture. Some of the egg whites will also float to the top, like cappuccino foam.'),
(7, 'Stir in spice(s).'),
(8, 'Serve in individual glasses with a grating or shake of nutmeg on top.');

