--
-- Dumping data for table `recipe78_potato_leek_soup_instructions`
--

INSERT INTO `recipe78_potato_leek_soup_instructions` (`id`, `instruction`) VALUES
(1, '1. Heat olive oil in a large, heavy-bottomed pot over medium-high heat. Add potatoes and leeks and season with salt and pepper. '),
(2, '2. Cook, stirring occasionally until the leeks are bright green and have begun to sweat, 5 to 8 minutes.  Add water and bouillon (or vegetable broth) and bring to a simmer. Simmer for 30-40 minutes.'),
(3, '3. Smash the potatoes in the pot with a wooden spoon or your ladle or whatever your need. Hulk smash.'),
(4, '3. Add the greens, stirring to wilt them into the soup.\n\n'),
(5, '4. Add vinegar and simmer another minute or so. Season with salt, pepper, and maybe a little more vinegar.'),
(6, '5. Ladle into a bowl, shower with scallions and a lot of dill. Lots. Of. Dill. Do not skimp on the dill. Grind more black pepper on the whole thing. \n(option to add plain yogurt or sour cream)');

