--
-- Dumping data for table `recipe82_britt_s_famous_roast_chicken_instructions`
--

INSERT INTO `recipe82_britt_s_famous_roast_chicken_instructions` (`id`, `instruction`) VALUES
(1, 'Salt chicken three days ahead of time (1-2 will work, but 3 is where the magic happens). Put it in the pan you plan on roasting it in breast side up.\nShake some pepper on it at this time.'),
(2, 'Preheat oven to 425° - have the thighs pointing towards the back left of the oven (the hottest part) and your chances of extra tasty crispy skin go way up.'),
(3, 'Stick some celery bits in the cavity along with a few lemon slices. (Don\'t overpack). Add a sprig or two of thyme. \n'),
(4, 'Put some celery, carrots, little potatoes (or big potatoes chopped into little potato size), onions, garlic cloves, okra, whatever ya got around the chicken in the pan. Or skip all that and pack that pan with green cabbage. Drizzle with a little avocado oil or high smoke point fat.'),
(5, 'Posi\nRoast at 425° til you smell it. I never use a timer, but it\'s probably about 30 minutes.'),
(6, 'Once you smell it, drop heat down to 335° (yes, 335°  - I don\'t want to risk overheating the olive oil you\'re about to drizzle all over it, which smokes at 350°. And who doesn\'t have a finicky oven these days? ) and use a brush to baste the chicken with it\'s drippings, then drizzle olive oil over it. If the veggies need more oil, they can have some olive oil too.'),
(7, 'Cook at 335° for around an hour. It\'s done when you can pull the whole wing off easy peasy. '),
(8, 'Tear into the chicken with your hands and eat like a savage. (Optional, but highly recommended).');

