(105, 1, '2020-12-01 21:19:00', '2020-12-01 21:19:00', '<!-- wp:paragraph -->\n<p>Hi there!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Glad you\'ve landed on my site. I\'d love to know about you, and here\'s a little about me:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>My career started off with me earning a degree in Linguistics from UC Santa Barbara. While there, I took a Computational Linguistics course, and was first exposed to NLP when functional conversational AI assistants were merely a pipe dream. I was hooked. After a few years as a project manager at TransPerfect Translations, I taught myself Python and completed a fellowship at Hackbright Academy, an Accelerated Software Engineering program for women.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>After that, I landed a job at Midea Emerging Technology Group where I worked as an NLP software engineer. Happily tinkering away at one of the most complex problems in computer science: getting robots to understand human speech, I learned the ins and outs of what makes a chatbot tick. This led to my favorite part of making the bots: conversation design.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Since discovering the fusion of the strategic and creative writing that makes up conversation design, I am obsessed. I consume as much content as possible to learn how to facilitate pleasant human-computer interaction, and am passionate about writing compelling microcopy to help solve people’s issues via conversational AI.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In the rare hours I’m not studying conversation design, developing chatbots or building voice apps for Alexa on the side, I enjoy camping, cooking, spelunking and diving down rabbit holes researching nutrition.</p>\n<!-- /wp:paragraph -->', 'About Me', '', 'inherit', 'closed', 'closed', '', '68-revision-v1', '', '', '2020-12-01 21:19:00', '2020-12-01 21:19:00', '', 68, 'https://brittanyjewellneal.com/2020/12/01/68-revision-v1/', 0, 'revision', '', 0),
(104, 1, '2020-12-01 21:18:34', '2020-12-01 21:18:34', '<!-- wp:image {\"id\":76,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://brittanyjewellneal.com/wp-content/uploads/2020/11/brittany_casual-1022x1024.jpg\" alt=\"Brittany on ferry in Sweden\" class=\"wp-image-76\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Hi there!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Glad you\'ve landed on my site. I\'d love to know about you, and here\'s a little about me:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>My career started off with me earning a degree in Linguistics from UC Santa Barbara. While there, I took a Computational Linguistics course, and was first exposed to NLP when functional conversational AI assistants were merely a pipe dream. I was hooked. After a few years as a project manager at TransPerfect Translations, I taught myself Python and completed a fellowship at Hackbright Academy, an Accelerated Software Engineering program for women.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>After that, I landed a job at Midea Emerging Technology Group where I worked as an NLP software engineer. Happily tinkering away at one of the most complex problems in computer science: getting robots to understand human speech, I learned the ins and outs of what makes a chatbot tick. This led to my favorite part of making the bots: conversation design.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Since discovering the fusion of the strategic and creative writing that makes up conversation design, I am obsessed. I consume as much content as possible to learn how to facilitate pleasant human-computer interaction, and am passionate about writing compelling microcopy to help solve people’s issues via conversational AI.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In the rare hours I’m not studying conversation design, developing chatbots or building voice apps for Alexa on the side, I enjoy camping, cooking, spelunking and diving down rabbit holes researching nutrition.</p>\n<!-- /wp:paragraph -->', 'About Me', '', 'inherit', 'closed', 'closed', '', '68-revision-v1', '', '', '2020-12-01 21:18:34', '2020-12-01 21:18:34', '', 68, 'https://brittanyjewellneal.com/2020/12/01/68-revision-v1/', 0, 'revision', '', 0),
